  try {

    const response = await fetch('http://localhost:8523/login', {
    method: 'POST' ,
    headers: {
        'Content-Type': 'text/plain'
    },
    body: JSON.stringify(user)
    }).then(res => {
    if (response.ok) {
          console.log(response.json())
          alert("Logged in");
            // REDIRECT USER 
        } else {
          alert("Could not log in"); 
        }
    })
  } catch (error) {
    console.error("Fetch error:", error);
    alert("Error ocurred while loggin in."); 
  }
}
function Login() {
const [data, setData] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleSubmit = async (event) => {
    event.preventDefault();
    setLoading(true);
    setError(null);

    try {
      const response = await fetch('your-api-endpoint', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ key: 'value' }), // Replace with your data
      });

      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }

      const responseData = await response.json();
      setData(responseData);
    } catch (e) {
      setError(e);
    } finally {
      setLoading(false);
    }
  };
    return (
        <form>
            <input placeholder="Email" type="email" id="email"></input>
            <input placeholder="password" type="password" id="password"></input>
            <button onClick={LoginRequest}>Log in</button>
        </form>
    )
}

export default Login;
